import React from 'react';
import qs from 'qs';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

export default function CourseDetail(){

    const courseSelectedStr = localStorage.getItem('courseSelected');
    const courseSelected = qs.parse(courseSelectedStr);
    console.log(courseSelected);

    return(
        <div>

            <Card class="courseCard">
              <Card.Header as="h5" className="courseTitle">{courseSelected.courseName}</Card.Header>
              <Card.Body>
                <Card.Title>Special title treatment</Card.Title>
                <Card.Text>
      With supporting text below as a natural lead-in to additional content.
    </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>

        </div>
    );

}
